import Data.Char

type Cargo = [[Char]]

readLine :: String -> Cargo -> Cargo
readLine x [] = []
readLine x (y:ys) 
    | z == "   " = y : (readLine (tail zs) ys)
    | otherwise = ((z !! 1) : y) : (readLine (tail zs) ys)
    where (z, zs) = splitAt 3 x

splitOn :: Char -> String -> [String]
splitOn _ [] = []
splitOn delim target = 
    let (x, xs) = span (/= delim) target in 
        x : (splitOn delim (if null xs then [] else tail xs))

process :: String -> Int -> Cargo
process x y = foldr (\x y -> readLine x y) (generate y) (splitOn '\n' x)

generate :: Int -> Cargo
generate x = map (const []) [0..(x - 1)]

evalCommand :: String -> Cargo -> Cargo
evalCommand command cargo = modify (modify cargo from (drop count (cargo !! from))) to ((take count (cargo !! from)) ++ (cargo !! to))
    where (count, from, to) = parseCommand command

parseCommand :: String -> (Int, Int, Int)
parseCommand x =  (toInt a, (toInt b) - 1, (toInt c) - 1)
    where [_, a, _, b, _, c] = splitOn ' ' x

toInt :: String -> Int
toInt x = read x

modify :: [a] -> Int -> a -> [a]
modify x index y = (take index x) ++ [y] ++ (drop (index + 1) x)

eval :: String -> Cargo -> Cargo
eval commands cargo = foldr (\x y -> evalCommand x y) cargo (reverse (splitOn '\n' commands))

tops :: Cargo -> [Char]
tops = map (head)

